        public
        view
        virtual

        returns (address)
    {
        require(
            _exists(tokenId),
            "ERC721: approved query for nonexistent token"
        );

        LibERC721Storage.ERC721Storage storage es = LibERC721Storage.erc721Storage();

        return es._tokenApprovals[tokenId];
    }

    /**
     * @dev See {IERC721-transferFrom}.
     */
